import React, { useState } from 'react';
//import '../pages/styles/view.css';

const Veiw = () => {
  return (
    <div>
      <h1>ホームページ</h1>
      <label>
        表示する:
        <input 
          type="checkbox" 
          checked={isVisible} 
          onChange={handleVisibilityChange} 
        />
      </label>
      <div>
        <button onClick={updateAnimalSettings}>サイズを更新</button>
      </div>
    </div>
  );
};

export default Veiw;
